import './App.css';

function App() {
  return (
    <div className="Container">
      <div className="App">
        <h1>ADA Compliance Checker</h1>
        <textarea id="textbox" placeholder="Enter something..." />
        <button onclick="handleSubmit()">Submit</button>
      </div>
      <div>
        <p id="result"></p>
      </div>
    </div>
  );
}

export default App;
